    false,nt"url": null,nt"notes": "This narrative report for Blackwater NWR
    outlines Refuge accomplishments from May through July of 1941. The report begins
    by summarizing the weather conditions during this period. Wildlife- including migratory
    birds, upland game birds, furbearers, predators, rodents, and fish- is also covered.
    The Refuge development and maintenance section discusses physical developments and
    plantings. Resource management is outlined; topics include cooperative farming.
    The public relations section of the report describes recreational uses.",nt"license_title":
